import React from 'react';
import phone from '../Images/img-1.png';
import s from './HedFot.module.css';

export default class HedFot extends React.Component {
  render() {
    return (
      <div className={s.hedfot}>
        <div className={s.item}>
          <div className={s.item2}>
            <h1>
              OUR PRODUCT IS <span> BETTER</span> THAN OTHER
            </h1>
            <p>
              Lorem Ipsum is simply dummy text of <br /> the printing and
              typesetting industry.
              <br /> Lorem Ipsum has been the industry's
              <br /> standard
            </p>
            <div className={s.btn}>
              <p>Get Free App</p>
              <p className={s.p}>Go Premium</p>
            </div>
          </div>
          <div className={s.item3}>
            <img src={phone} />
          </div>
        </div>
      </div>
    );
  }
}
